INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`)
VALUES
	(1,'node',' cod help for the latest documentation please visit http drupalorg documentation build cod  cod is the conference organizing distribution used for building conference and event sites in drupal you may first be interested in an overview of cod s capabilities  the primary project page is at http drupalorg project codsupport  this documentation is based on the packaged cod beta 1 downloaded from usecodcom download  with some additional documentation that will be released in beta 1 while we have tried to make the interface and documentation useful learning about fundamental drupal concepts such as permissions and essential modules such as views and ubercart are necessary to get the most out of cod getting started download cod need help downloading cod  install cod as you would any other drupal site but choose conference organizing distribution see the drupal installation guide for more details once installed and logged you will be user 1 with administrative capabilities create a few test users note that cod ships with many default settings that you will override as you create your site these user roles are created automatically session organizer site administrator and sponsor organizer roles you may want to add additional roles such as attendee and speaker depending on how you want people to interact with the site you can edit roles anytime cod does not enable most permissions by default intentionally so you ll need to add permissions for each of your roles or people won t be able to register suggest sessions vote etc you can edit permissions anytime comments are disabled by default on events sponsors rooms time slots and schedule items the default home page is the cod configuration instructions you should unpublish it before making the site available to nonadmins create a new home page with views panels or a single node that s configured to be the front page conference management menu common conference management tasks eg session moderation appear in the admin module menu collapsed this looks like a small wrench in the upper left corner of your browser window clicking on it will expand it display an administration menu which you ll use to administer your site the menu items here can also be customized as we have done with the conference management section of the admin toolbar display images be sure to enable imageapi gd2 or imageapi imagemagick enable imagecache ui optional  create an event for people to attend first create an event node node add event title sku and a sell price are required for paid events but description start date time and end date time are highly recommended everything else is optional install and configure an ubercart payment gateway or disable uninstall ubercart if you aren t going to charge for your event ensure people can find the link to sign up either by creating a block or primary menu link check permissions as in anonymous users have permission to sign up and start promoting sponsor setup enable the cod sponsors feature is enabled by default admin build modules this also enables the conference administration admin menu if needed modify sponsor levels eg platinum in the allowed values list of the sponsor content type admin content nodetype sponsor fields fieldsponsorshiplevel adjust permissions if you d like sponsors to create their own sponsor node it will remain unpublished until an admin approves and publishes it modify sponsor view if you d like additional sponsor levels to appear on the sponsor page by default only platinum display or arrange the blocks admin build block so the other levels there are separate sponsor blocks for home page and internal pages if needed rename sponsor levels in the view assign sponsor blocks to regions check viewing and editing permissions are appropriate for your needs note that only published sponsor nodes display community configuration attendees  full names and photos of attendees are displayed and filterable at community only people who have signed up for the event ie have a signup id associated with their user account will appear in this list the cod community feature is enabled by default admin build modules you can perform views bulk operations on anyone with an account the codcommunity view displays name photo and core profile fields of signed up users out of the box with exposed filters a forum menu link also appears attendee profiles user accounts contain any personal information tab first and last name are required because they display in the community page and for presenters their full name will display on schedules and session nodes organization company name job title and interests are optional you can also modify these or create additional fields at admin user profile add signups manually without payment in some cases you may want to give away tickets and not collect payment from them like for keynote speakers sponsors organizers or other volunteers to do this you will need the administer user s and the administer signup permission create a user account for the person if there isn t one already go to the event node and click signups click add to create a signup enter username click signup they will be added to the list of attendees should get an email notification immediately and will get a reminder notification before the event if configured  session collection enable the cod session feature is enabled by default admin build modules this enables the conference administration admin menu update the session track field allowed values in the session content type admin content nodetype session fields fieldtrack as sessions are created visit the session administration conferenceadmin sessions to manage sessions review and publish submitted sessions so they are visible to the public voting on sessions voting usually begins once you ve finished accepting new sessions so votes are applied fairly adjust flag access on the session vote flag flags manage sessionvote to allow other roles to vote on sessions you will probably want to do some additional theming to ensure the vote for this session links are more prominent on session nodes or build a view that shows all notes that haven t been voted on by the current user filterable by track experience level remove the flag access by role flags manage sessionvote when you want to stop allowing people to vote create the schedule the codschedule view is restricted by default to keep it private while organizers are still working on it it doesn t display anything until rooms and time slots are created and sessions are assigned to time slots create room and time slot nodes these will be the framework for your schedule sessions and schedule items are different content types a schedule item is something like lunch that doesn t have a presenter or track but needs to be assigned a room and time slot sessions and schedule items can be assigned to multiple rooms assign an item to all rooms for it span the width of the schedule grid and indicate there are not other sessions planned during that time eg registration sessions and schedule items need to have a room and time slot assigned to them to appear in the schedule as well as be accepted and published you won t be able to schedule two sessions schedule items in the same time slot and room a warning message will appear explaining the conflict when you are happy with the schedule change the view access restriction accordingly  your schedule display when you re ready for people to add sessions to their personal schedule go to admin build flags edit the sessionschedule flag and assign access to this flag to one or more roles you can add this flag to additional scheduleable content types eg bof or workshops make any other configuration changes you wish then save checking in attendees the conference management menu has a check in attendees link to conferenceadmin checkin you must have the attendee manager role to use this list this list shows everybody who has a signup id along with their full names username signup time and more when attendees arrive to collect their badge and other materials simply put a checkbox next to their name and click mark signup attended you may want to make modifications to this view including removing the button marked signup did not attend if there is a chance the wrong button may be used inadvertently during a crowded registration morning and you may want to display more than 100 attendee names at once other configuration considerations cod includes default empty text in the views you may want to review and change this text as needed  ',0),
	(2,'node',' program  tip you can use this page to describe the overall schedule for your event for example day 12 sessions day 3 training workshops link to content as needed day one oct 19 2011 breakfast and registration preconference training speakers reception day two oct 20 2011 breakfast and registration sessions opening night party day three oct 21 2011 breakfast and registration sessions exhibits and posters day four oct 22 2011 breakfast and registration sessions wrap party  ',0),
	(3,'node',' announcing drupalcampnyc 10 we are happy to announce the date for the next drupalcampnyc drupalcampnyc 10  saturday december 10 th 2011 it will be at a new venue john jay college of criminal justice on tenth avenue and 58 th street on the upper west side of manhattan drupalcampnyc 10 will have space for 500 attendees 4 tracks development design business beginners room for 10 bofs drupal training the day before the camp other benefits we will be soliciting session proposals in early october and registration will open in late october we will announce registration dates a week in advance on twitter on the nyc drupal group page and our drupalcampnyc 10 mailing list so subscribe today so you don t miss out looking forward to seeing you in nyc  ',1313875990);
